import React, { Component } from 'react'

class TodoComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
            id: this.props.match.params.id,
        }
    }
    render() {
        return (
            <div> todo component for {this.state.id} </div>
        )
    }
}

export default new TodoComponent
